import React from 'react';

class StreamList extends React.Component {
  listStreams = () => {
   return this.props.streamInfo.map(stream => <img key={stream.id} name={stream.name} src={stream.url} alt={stream.name} />)
  }

  render() {
    return (
      <div className="streams">
        {this.listStreams()}

      </div>
    )
  }
}

export default StreamList;
